_080‍.x([["LinkedListNode",()=>LinkedListNode]]);// Linked List node class
// value = node value
// next = next node pointer from the current node

       class LinkedListNode {
  constructor(value, next = null) {
    this.value = value;
    this.next = next;
  }

  get value() {
    return this.value;
  }

  set value(val) {
    this.value = val;
  }
}
